import "./fonts/MSignUp.css";
import { useNavigate } from "react-router";
import React, { useEffect, useState } from "react";
import axios from "axios";

function SignUp() {
  const history = useNavigate();
  const [firstName, setFirstName] = useState("");
  const [lastName, setLastName] = useState("");
  const [phoneNumber, setPhoneNumber] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [address, setAddress] = useState("");
  function handleClick() {
    console.log(email)
    axios.post("http://localhost:4000/api/resident/register/ce", {
      email: email,
    }).then((res) => {
      console.log(res);
      
    }).catch((err) => {
      alert(err)
    })
    history("/signupc", {
      state: {
        fname: firstName,
        lname: lastName,
        pnum: phoneNumber,
        email: email,
        pass: password,
        addy: address,
      },
    });
  }

  return (
    <div class="background">
      <div class="colorspace">
        <p class="heading">S I G N &nbsp; U P</p>
        <div class="shopimg" />
      </div>
      <div class="whitespace">
        <p class="loginheading">Sign Up</p>
        <input
          className="input"
          placeholder="First Name"
          value={firstName}
          onChange={(e) => setFirstName(e.target.value)}
        />
        <input
          className="input"
          placeholder="Last Name"
          value={lastName}
          onChange={(e) => setLastName(e.target.value)}
        />
        <input
          className="input"
          placeholder="Phone Number"
          value={phoneNumber}
          onChange={(e) => setPhoneNumber(e.target.value)}
        />
        <input
          className="input"
          placeholder="Email"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
        />
        <input
          className="input"
          placeholder="Password"
          type="password"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
        />
        <input
          className="input"
          placeholder="Address"
          value={address}
          onChange={(e) => setAddress(e.target.value)}
        />
        <button class="nstep" onClick={handleClick}>
          Next Step
        </button>
        <div class="btext">
          <p class="btexta">Already have an account?</p>
          <button
            class="btextb"
            onClick={(e) => {
              window.location.href = "/signin";
            }}
          >
            Login
          </button>
        </div>
      </div>
    </div>
  );
}
export default SignUp;
